import React from 'react';
import ReactDOM from 'react-dom';
import "./App.css";

const myelement = (
	<div>
		<h1>Hi there!</h1>
	  	<ul>
			<li>
		  		<a>Divide And Conquer</a>
			</li>
	  	</ul>
	</div>
);

ReactDOM.render(myelement, document.getElementById('root'));
